import './Cryptic.style.css';
const Cryptic = ({ passwordList }) => {
  return (
    <>
      <div>
        {passwordList.length > 1 ? (
          <select name='' id=''>
            {passwordList.map((option) => (
              <option key={option._id} value={option.passwordOrg}>
                {option.passwordOrg}
              </option>
            ))}
          </select>
        ) : null}
      </div>
      <div className='w-full cryptic-container'>
        <div>
          <input type='text' name='' id='' className='message' />
        </div>
        <div>
          <button>Encrypt</button>
          <button>Decrypt</button>
        </div>
        <div>
          <input type='text' className='message message-output' />
        </div>
      </div>
    </>
  );
};

export default Cryptic;
